settings.custom_css:
.gradient3{
background: linear-gradient(155.91deg, #F87444 0%, #EB3C7A 100%);
-webkit-background-clip: text; -webkit-text-fill-color: transparent;
}
.btn{
    width: 100%;
        background-image: linear-gradient(
60deg
,#f79533,#f37055,#ef4e7b,#a166ab,#5073b8,#1098ad,#07b39b,#6fba82) !important;
    -webkit-animation: animatedgradient 3s ease infinite alternate;
    animation: animatedgradient 3s ease infinite alternate;
    background-size: 300% 300%;
    border-radius: 7px;
}

@keyframes animatedgradient {
	0% {
		background-position: 0% 50%;
	}
	50% {
		background-position: 100% 50%;
	}
	100% {
		background-position: 0% 50%;
	}
	 10%,
  90% {
    transform: translate3d(-1px, 0, 0);
  }
  20%,
  80% {
    transform: translate3d(2px, 0, 0);
  }
  30%,
  50%,
  70% {
    transform: translate3d(-4px, 0, 0);
  }
  40%,
  60% {
    transform: translate3d(4px, 0, 0);
  }
}

.bold{
    font-weight:700;
}

selector{
  background: rgba(126,1,206,0.1);
  backdrop-filter: saturate(180%) blur(50px);
}
